(1, '2017-09-26 13:17:25', '2018-04-12 04:12:46', 1, 20, 'Singsys IT Asset Management System', 1, 'Singsys Pte. Ltd.', NULL, NULL, NULL, 0, '', 1, 'logo.png', '#30b5be', 'pratosh@singsys.com', 1, '                                  Usage policy\r\n1. I understand and acknowledge that I will use the equipment for official purposes related to my position at the Company.\r\n2. I agree not to tamper with any hardware or software, nor to allow others to do so. Equipment will be loaded with a standard suite of approved software and security applications installed by the Company.\r\n3. Employees who have permission to work with Personally identifiable Information (PII) Data, including student record information, are prohibited from downloading files containing such information to the local hard drive of the Equipment.\r\n4. I understand that the Company is not responsible for the loss of or damage to any of my work on the Laptop. I am responsible for all data stored on the Laptop in terms of security and backup. The Department of Systems recommends saving all files to your Company-based storage.\r\n5. All use of the Equipment shall adhere to the Company’s Authorized Use Policy.\r\nIt is my responsibility to deliver the Equipment to a designated location for updates upon notification from the Systems Department.\r\n6. In the event that my employment with the Company ends, I will return the Equipment to the Systems Department on or before my last day of employment. If I fail to return the Equipment, I understand that I may be liable for the replacement cost of the Equipment.\r\n7. I understand that I will be in default of this Agreement if I: (i) fail to care for and maintain the condition of the Equipment; (ii) misuse or abuse the Equipment; (iii) loan or make any other transfer of the Equipment; or (iv) violate any of the other terms or conditions of this Agreement. A default may result in criminal prosecution or civil liability, including liability for the replacement cost of the Equipment. In addition, upon the Systems member’s default, the Company has the right to take immediate possession of the Equipment.\r\n', 'QRCODE', 'https://hooks.slack.com/services/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', '#general', 'Singsys-IMS', 'INR', '', 1, NULL, NULL, NULL, NULL, NULL, NULL, 'samaccountname', 'sn', 'givenname', 'uid=samaccountname', 3, NULL, NULL, NULL, 0, 0, 'en', 30, '2.62500', '1.00000', '0.21975', '0.21975', '0.50000', '0.50000', '0.07000', '0.05000', 9, '10.00000', '15.00000', 1, 1, 1, 'C39', 1, 70, 1, 'singsys.com', 'filastname', 'filastname', 0, NULL, '389', 0, 11, 1, NULL, 1, 'D M d, Y', 'g:iA', 289, 'If you do not have a login or have found a device belonging to this company, please  contact to system team for further details.', 50, 0, NULL, 10, 1, 5, 0, NULL, 1, 0, 0, 'Hello Thanks for Visit !', 'admin', '', 'image,category,manufacturer,model_number', 'red-dark', 1, 'pratosh@singsys.com');
